        {expos.map((item, index) => (
          <div className="card-exp" key={index}>
            <div className="card-exp-body">
              <h5 className="card-exp-title">{item.title}</h5>
              <p className="card-exp-p"></p>
              <p className="card-exp-text">{item.stand}</p>
